import React from "react"
import close from '../static/img/close.svg'

export default class Cookie extends React.Component{
    render(){
        return(
            <React.Fragment>
                <div className="cookieDiv">
                    <img src="close" alt="" />
                    <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.</p>
                </div>
            </React.Fragment>
        )
    }
}
